    payments issued to Kabel Business Services to identify the individuals and vendors
    who received payment; provides additional information with regard to reimbursement
    for travel/subsistence in excess of $500 on Schedule B; and provides the original
    vendor payments made by credit card on Schedules B. Further, during this reporting
    period, payroll, payroll taxes and fringe benefits for any committee employee
    who spent 25% or more of their time on activities related to a Federal election
    are being reported as Federal Election Activity; and all salaries, wages and/or
    fringe benefits reported on Schedule H4 are for employees who spent less than
    25% of their time on federal election activity or in connection with a Federal
    election.  The committee hereby incorporates by reference Form 99 miscellaneous
    Report, June 20, 2009, outlining its policies with regard to payments received
    by candidate committees for goods and services provided.  The Republican Party
    of Iowa owns and operates its own building and land at its headquarters in Des
    Moines, Iowa. This committee does not recognize registered lobbyists or registrant
    committees for purposes of aggregate contributions.\x1C\n"
